import React from 'react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';
import photo1 from '../../photos/JBL4325/DSC_0007.jpg'

const Portfolio = () => {
    const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1,
    };
    return (
        <Slider {...settings}>
        <div>
            <img src={photo1} alt='photo-1' />
        </div>
        <div>
            <img src='https://via.placeholder.com/350x150' alt='photo-2' />
        </div>
        <div>
            <img src='https://via.placeholder.com/350x150' alt='photo-3' />
        </div>
    </Slider>
    );
};

export default Portfolio;
